    false,nt"url": null,nt"notes": "This narrative report for Blackwater NWR
    outlines Refuge accomplishments from January through April of 1963. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, predators, rodents, mammals, raptors, fish,
    and reptiles- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, collections and receipts, and prescribed burning.
    Resource management is outlined; topics include fur harvesting, timber removal,
    and commercial fishing. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, and safety. Items of interest, N-R
    forms, and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
